;jQuery.fn.orSearch=function(n){var a=$.extend({'dropdown':'unknown'},n);return $(this).keyup(function(){var n=$(this).val();if(n.length>3){$(a.dropdown).html('');$.ajax({'type':'GET',url:'./api/?action=search&subaction=quicksearch&output=json&search='+n,data:null,success:function(t,e,d){for(id in t.output.result){var n=t.output.result[id];$(a.dropdown).append('<div class="entry clickable" title="'+n.desc+'"><a href="javascript:void(0);" data-type="open" data-name="'+n.name+'" data-action="'+n.type+'" data-id="'+n.id+'"><img src="'+OR_THEMES_EXT_DIR+'default/images/icon_'+n.type+'.png" />'+n.name+'</a></div>')};$(a.dropdown).orLinkify()}});$(a.dropdown).fadeIn()}
else{$(a.dropdown).fadeOut()}})};